<html>
    <head>
        <!-- General styles, not used by all email clients -->
        <style type="text/css" media="all">
            a {
                text-decoration: none;
                color: #0088cc;
            }
            hr {
                border-top: 1px solid #999;
            }
        </style>
    </head>

    <!-- KEEP THE LAYOUT SIMPLE: THOSE ARE SERVICE MESSAGES. -->
    <body style="margin: 0; padding: 0;">

        <!-- Top title with dark background -->
        <table style="background-color: #444; width: 100%;" cellspacing="0" cellpadding="0">
            <tr>
                <td style="padding: 20px; text-align: center; font-family: sans-serif; color: #fff; font-size: 28px">
                    {blog_title}
                </td>
            </tr>
        </table>

        <!-- Main table 100% wide with background color #eee -->    
        <table style="background-color: #eee; width: 100%;">
            <tr>
                <td align="center" style="padding: 15px;">

                    <!-- Content table with backgdound color #fff, width 500px -->
                    <table style="background-color: #fff; max-width: 600px; width: 100%; border: 1px solid #ddd;">
                        <tr>
                            <td style="padding: 15px; color: #333; font-size: 16px; font-family: sans-serif">
                                <!-- The {message} tag is replaced with one of confirmation, welcome or goodbye messages -->
                                <!-- Messages content can be configured on Newsletter List Building panels --> 

                                {message}

                                <hr>
                                <!-- Signature if not already added to single messages (surround with <p>) -->
                                <p>
                                    <small>
                                        <a href="{blog_url}">{blog_url}</a><br>
                                        {company_name}<br>
                                        {company_address}
                                    </small>
                                </p>
                                

                            </td>
                        </tr>
                    </table>

                </td>
            </tr>
        </table>

    </body>
</html>";}";s:25:"newsletter_unsubscription";s:668:"a:6:{s:16:"unsubscribe_text";s:103:"<p>Please confirm you want to unsubscribe <a href="{unsubscription_confirm_url}">clicking here</a>.</p>";s:10:"error_text";s:99:"<p>Subscriber not found, it probably has already been removed. No further actions are required.</p>";s:17:"unsubscribed_text";s:124:"<p>Your subscription has been deleted. If that was an error you can <a href="{reactivate_url}">subscribe again here</a>.</p>";s:20:"unsubscribed_subject";s:7:"Goodbye";s:20:"unsubscribed_message";s:87:"<p>This message confirms that you have unsubscribed from our newsletter. Thank you.</p>";s:16:"reactivated_text";s:46:"<p>Your subscription has been reactivated.</p>";}";s:33:"newsletter_unsubscription_version";s:5:"1.0.0";s:23:"newsletter_profile_main";s:546:"a:8:{s:4:"text";s:188:"{profile_form}
